ущен в двух модификациях: переднеприводный и полноприводный. Особое внимание было направлено производителем на мощность автомобиля. Уже в 1995 году автомобиль оснастили двигателем мощностью 2,8 литра, а летом того же года появляется автомобиль с двигателем 3,7 литра, а еще позже, мощность объем двигателя увеличивается до 4,2 литров при мощности в 310 л.с. Двигатели оснащены восемью и шестью цилиндрами, в зависимости от модификации. Подкупающим бонусом концерна, стал бесплатный кондиционер, который входит в стоимость автомобиля базовой комплектации. Немаловажную роль в таком «монстре» играют и подушки безопасности. Четыре надувных подушки по бокам и дополнительные, установленные для обеспечения безопасности водителя и переднего пассажира выполняют свои функции на 100 % и можно быть уверенным в смягчении удара при ДТП.\r\n\r\nНовизна автомобиля заключается именно в двигателе. До этого у Audi не было V- образного двигателя, который достигал мощности 340 л.с., коробка передач механическая, шестиступенчатая. Что не особо удобно для управления автомобилем такой мощности. Достижению высокой скорости способствует специальный легкий сплав кузова из алюминия, который обладает высокой поглощающей способностью энергии при ударе. Данное оснащение помогает повысить эффективность работы подушек безопасности, а так же общей безопасности автомобиля в целом. Единственной модификацией, имеющей автоматическую коробку передач, является серия S8, но коробка пятиступенчатая. Автомобиль является четырехдверным седаном, с передним и полным приводами, в зависимости от выбираемой модификации. Объем бака составляет 80-90 литров.\r\n\r\nАвтомобиль не дешев и предназначается для людей, которые способны за качество и великолепный представительский дизайн выложить немалые деньги. На спидометре красуется отметка в 242 км/ч, и можете поверить, автомобиль реально может развить эту скорость, так как свои 100 км/ч он набирает за 8,2 секунд. При этом стоит учесть неизменную экономичность в 7,3 литров на 100 км. Этот автомобиль стоит тех денег, за которые выставлен на рынке.'),(89,9,'Allroad',NULL),(90,9,'Cabriolet',NULL),(91,9,'Coupe',NULL),(92,9,'NSU RO 80',NULL),(93,9,'Q7',NULL),(94,9,'Quattro',NULL),(95,9,'R8',NULL),(96,9,'RS2',NULL),(97,9,'RS4',NULL),(98,9,'RS6',NULL),(99,9,'S2',NULL),(100,9,'S3',NULL),(101,9,'S4',NULL),(102,9,'S5',NULL),(103,9,'S6',NULL),(104,9,'S8',NULL),(105,9,'TT',NULL),(106,9,'V8 (D11)',NULL),(107,10,'Allegro',NULL),(108,10,'Ambassador',NULL),(109,10,'Maestro',NULL),(110,10,'Maxi',NULL),(111,10,'Metro',NULL),(112,10,'Mini MK',NULL),(113,10,'Montego',NULL),(114,10,'Princess',NULL),(115,11,'A 112',NULL),(116,12,'BJ 2020',NULL),(117,13,'Arnage',NULL),(118,13,'Azure',NULL),(119,13,'Brooklands',NULL),(120,13,'Continental',NULL),(121,13,'Mulsanne',NULL),(122,13,'Turbo R',NULL),(123,14,'Freeclimber',NULL),(124,15,'Type 3 Cabriolet',NULL),(125,16,'TF 2000 MK1',NULL),(126,17,'1 series',NULL),(127,17,'3 series',NULL),(128,17,'5 series',NULL),(129,17,'6 series',NULL),(130,17,'7 series',NULL),(131,17,'8 series',NULL),(132,17,'M',NULL),(133,17,'X',NULL),(134,17,'Z',NULL),(135,18,'M1',NULL),(136,18,'M2',NULL),(137,19,'Blenheim',NULL),(138,19,'Fighter',NULL),(139,19,'Speedster',NULL),(140,20,'EB 110',NULL),(141,20,'EB 112',NULL),(142,20,'EB 16.4',NULL),(143,21,'Century',NULL),(144,21,'Enclave',NULL),(145,21,'GL8',NULL),(146,21,'LaCrosse',NULL),(147,21,'LE Sabre',NULL),(148,21,'Lucerne',NULL),(149,21,'Park Avenue',NULL),(150,21,'Rainer',NULL),(151,21,'Reatta',NULL),(152,21,'Regal',NULL),(153,21,'Rendezvous',NULL),(154,21,'Riviera',NULL),(155,21,'Roadmaster',NULL),(156,21,'Sedan',NULL),(157,21,'Skylark',NULL),(158,21,'Terraza',NULL),(159,22,'F3',NULL),(160,22,'FLYER II',NULL),(161,23,'Allante',NULL),(162,23,'BLS',NULL),(163,23,'Brougham',NULL),(164,23,'Catera',NULL),(165,23,'CTS',NULL),(166,23,'DE Ville',NULL),(167,23,'DTS',NULL),(168,23,'Eldorado',NULL),(169,23,'Escalade',NULL),(170,23,'Evoq',NULL),(171,23,'Fleetwood',NULL),(172,23,'LSE',NULL),(173,23,'S